"use strict";(self.webpackChunkdevdocs=self.webpackChunkdevdocs||[]).push([[15934],{91714:e=>{e.exports=JSON.parse('{"label":"Quality Assurance","permalink":"/moodledevdocs/general/tags/quality-assurance","allTagsPath":"/moodledevdocs/general/tags","count":18,"items":[{"id":"app/development/testing/acceptance-testing","title":"Acceptance testing for the Moodle App","description":"In order to run tests that carry out automated functionality testing for the Moodle App, you can write Acceptance tests. This can be useful if you want to test plugins that are compatible with the app, or you\'re contributing to the app core. Behat tests for the app work the same way as tests for Moodle core, but they are not run as part of a normal Behat execution and there are some differences that we\'ll go through in this page.","permalink":"/moodledevdocs/general/app/development/testing/acceptance-testing"},{"id":"development/tools/behat/index","title":"Behat","description":"This page describes the internals of Behat and the integration with Moodle.","permalink":"/moodledevdocs/general/development/tools/behat/"},{"id":"development/tools/behat/browsers/index","title":"Browsers","description":"This page complements Behat providing info about how to run the acceptance tests suite in different browsers.","permalink":"/moodledevdocs/general/development/tools/behat/browsers/"},{"id":"app/development/testing/continuous-integration","title":"Continuous Integration for the Moodle App","description":"Tests can be useful during development, but a good test suite really shines with CI processes in place. Running tests and other checks on a regular basis can be helpful to maintain good quality assurance, and catch regressions as early as possible.","permalink":"/moodledevdocs/general/app/development/testing/continuous-integration"},{"id":"development/process","title":"Development process","description":"A summary of the various development processes used in Moodle development.","permalink":"/moodledevdocs/general/development/process"},{"id":"development/process-moodleapp","title":"Moodle App Development process","description":"The development of new features and improvements in the Moodle App is organised in the following six phases:","permalink":"/moodledevdocs/general/development/process-moodleapp"},{"id":"community/intro","title":"Overview","description":"This page gives an overview of the process of developing Moodle and outlines some of the basic concepts to better understand this Developer documentation.","permalink":"/moodledevdocs/general/community"},{"id":"development/tools/phpunit","title":"PHPUnit","description":"PHPUnit by Sebastian Bergmann is an advanced unit testing framework for PHP. It is installed as Composer dependency and is not part of Moodle installation. To run PHPUnit tests, you have to manually install it on your development computer or test server.","permalink":"/moodledevdocs/general/development/tools/phpunit"},{"id":"development/process/testing/qa","title":"QA testing","description":"All the information related to the Qualify Assurance tests during the Moodle development.","permalink":"/moodledevdocs/general/development/process/testing/qa"},{"id":"development/tools/behat/running","title":"Running acceptance tests","description":"Moodle uses Behat, a php framework for automated functional testing, as part of a suite of testing tools.","permalink":"/moodledevdocs/general/development/tools/behat/running"},{"id":"development/process/testing/index","title":"Testing","description":"All the information related to testing during the Moodle development.","permalink":"/moodledevdocs/general/development/process/testing/"},{"id":"community/credits/testing","title":"Testing credits","description":"The following people have helped with Quality Assurance (QA) testing:","permalink":"/moodledevdocs/general/community/credits/testing"},{"id":"development/process/testing/testing-lms-app","title":"Testing LMS issues in the mobile app","description":"Information related to mobile app testing of LMS issues","permalink":"/moodledevdocs/general/development/process/testing/testing-lms-app"},{"id":"development/process/testing/integrated-issues","title":"Testing of integrated issues","description":"All the information related to the integration review process during the Moodle development.","permalink":"/moodledevdocs/general/development/process/testing/integrated-issues"},{"id":"development/tracker","title":"Tracker introduction","description":"A summary of the most common actions in Moodle tracker.","permalink":"/moodledevdocs/general/development/tracker"},{"id":"app/development/testing/unit-testing","title":"Unit testing for the Moodle App","description":"Unit tests are written in JavaScript using Jest. If you want to create a new one, Jest is already configured and you only need to create a file ending with .test.ts within the project. If you\'re going to do so, remember to follow the file location conventions.","permalink":"/moodledevdocs/general/app/development/testing/unit-testing"},{"id":"development/tools/behat/browsers/supportedbrowsers","title":"Working combinations of OS+Browser+selenium","description":"As OS, Browsers and Selenium keeps updating, some combination might fail on different Moodle releases.","permalink":"/moodledevdocs/general/development/tools/behat/browsers/supportedbrowsers"},{"id":"development/tools/behat/writing","title":"Writing acceptance tests","description":"This documentation gives some hints on writing behat tests for Moodle core, and for plugins. The focus of the documentation is on behat tests for plugins. Behat Features and Scenarios are written in a natural language, and should","permalink":"/moodledevdocs/general/development/tools/behat/writing"}],"unlisted":false}')}}]);